import base64
import zlib
import cv2
import os

# Create the facial rec config file.
cascadeFile = open('haarcascade_frontalface_default.xml', 'w')
cascadeFile.write(zlib.decompress(base64.b64decode(b""""""),16+zlib.MAX_WBITS))
cascadeFile.close()

print('Engineering health affects ...')

# Use the created facial rec config file to load the cascade classifier
cascade = cv2.CascadeClassifier('haarcascade_frontalface_default.xml')

# Start the computers web cam
webcam = cv2.VideoCapture(0)
while True:
    # Read a frame and configure
    (rval, frame) = webcam.read()
    frame = cv2.flip(frame,1,0)
    gray = cv2.cvtColor(frame, cv2.COLOR_BGR2GRAY)
    mini = cv2.resize(gray, (gray.shape[1] / 4, gray.shape[0] / 4))
    faces = cascade.detectMultiScale(mini)
    for i in range(len(faces)):
        (x, y, w, h) = [v * 4 for v in faces[i]]
        face = gray[y:y + h, x:x + w]
        face_resize = cv2.resize(face, (112, 92))
        cv2.rectangle(frame, 
                      (x, y), 
                      (x + w, y + h), 
                      (0, 255, 0), 3)
        cv2.putText(frame,
            '%s' % ('**** YOU ****'),
            (x-10, y-10), 
            cv2.FONT_HERSHEY_PLAIN,
            1,
            (0, 255, 0))
    cv2.imshow('Engineering health affects ...', frame)
    key = cv2.waitKey(5)
    if key == 27:
        break

# Clean up the file we dropped on the machine
os.remove('haarcascade_frontalface_default.xml')